import styled from 'styled-components';

const imageArray = [
    {
        id: "1",
        src:"../../images/dk_w_rld_logo1.jpg"
    },
    {
        id: "2",
        src:"../../images/dk_w_rld_logo2.jpg"
    },
    {
        id: "3",
        src:"../../images/dk_w_rld_logo3.jpg"
    },
    {
        id: "4",
        src:"../../images/dk_w_rld_logo4.jpg"
    },
]

const Container = styled.div`
    position: relative;
    width: 500px;
    height: auto;
    margin: 0 auto;
    overflow: hidden;
    transform: translateY(50px);
    opacity: 1;
`;

const Slidercontainer = styled.div`
    width: 500px;
    height: 500px;
    display: flex;
`;

function ImageSlider({img}){
    return(
        <Container>
            <SliderContainer>
            {img.map(()=>{
                <img src={img.src} alt="some" />    
            })}            
            </SliderContainer>
            <button></button>
            <button></button>
        </Container>
    );
}

function Labs01() {
    return (
        <>
        <ImageSlider img={imageArray}/>
        </>
    )
}

export default Labs01
